import {Routes, Route} from "react-router-dom";
// Home Page
import HomePage from './pages/Home.js';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" index element={<HomePage />} />
      </Routes>
    </div>
  );
}

export default App;
